import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;

export const Background = styled(Wrapper)`
  background-color: #bbbbbb;
  width: 100%;
  height: 100%;
`;

export const Title = styled(w)`
  display: flex;
  justify-content: center;
  align-items: center;
`;

export const Form = styled.form``;
